    91‚Üí  const needsBodyParts = selectedFit !== null && selectedFit !== 'just_right';
    92‚Üí
    93‚Üí  const steps = [
    94‚Üí    ...(hasColors ? ['color'] : []),
    95‚Üí    ...(hasFitTypes ? ['fit_type'] : []),
    96‚Üí    'size',
    97‚Üí    'fit',
    98‚Üí    ...(needsBodyParts ? ['body_parts'] : []),
    99‚Üí    'ownership',
   100‚Üí  ];
   101‚Üí  const totalSteps = steps.length;
   102‚Üí
   103‚Üí  const animateToStep = (step: number) => {
