    color: colors.petrol500,
    textTransform: 'uppercase',
    letterSpacing: 0.5,
  },
  productMiniTitle: {
    ...typography.bodyMedium,
    fontSize: 14,
  },
  wizardContainer: {
    flex: 1,
    overflow: 'hidden',
  },
  stepsRow: {
    flexDirection: 'row',
    flex: 1,
  },
  stepWrapper: {
    width: SCREEN_WIDTH,
    paddingHorizontal: spacing.xl,
  },
  stepContent: {
    flex: 1,
    paddingTop: spacing.xl,
  },
  stepQuestion: {
    ...typography.h2,
    textAlign: 'center',
    marginBottom: spacing['2xl'],
  },
  // Color grid
  colorGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: spacing.md,
  },
  colorSwatch: {
    width: 60,
    height: 60,
    borderRadius: 30,
    borderWidth: 3,
    borderColor: 'transparent',
    overflow: 'hidden',
    backgroundColor: colors.surfaceElevated,
  },
  colorSwatchSelected: {
    borderColor: colors.petrol500,
  },
  colorSwatchImage: {
    width: '100%',
    height: '100%',
  },
  colorSwatchFallback: {
    width: '100%',
    height: '100%',
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: colors.surfaceElevated,
  },
  colorSwatchFallbackText: {
    ...typography.bodyMedium,
    color: colors.textMuted,
  },
  colorSwatchOther: {
    borderWidth: 2,
    borderColor: colors.border,
    borderStyle: 'dashed',
    justifyContent: 'center',
    alignItems: 'center',
  },
  colorSwatchOtherText: {
    fontSize: 28,
    color: colors.textMuted,
  },
  selectedLabel: {
    ...typography.bodyMedium,
    color: colors.textSecondary,
    textAlign: 'center',
    marginTop: spacing.lg,
  },
  customInput: {
    ...components.input,
    marginTop: spacing.lg,
    textAlign: 'center',
  },
