     1‚Üíimport { useState, useCallback, useRef } from 'react';
     2‚Üíimport {
     3‚Üí  View,
     4‚Üí  Text,
     5‚Üí  Pressable,
     6‚Üí  TextInput,
     7‚Üí  ActivityIndicator,
     8‚Üí  StyleSheet,
     9‚Üí  Animated,
    10‚Üí  Dimensions,
    11‚Üí  KeyboardAvoidingView,
    12‚Üí  Platform,
    13‚Üí} from 'react-native';
    14‚Üíimport { SafeAreaView } from 'react-native-safe-area-context';
    15‚Üíimport { Image } from 'expo-image';
    16‚Üíimport { useLocalSearchParams, useRouter } from 'expo-router';
    17‚Üíimport { colors, spacing, borderRadius, typography, components } from '../theme/tokens';
    18‚Üíimport { saveTryon, FitRating, BodyPartFit, LengthFit, SizeOption } from '../lib/supabase';
    19‚Üí
    20‚Üíconst { width: SCREEN_WIDTH } = Dimensions.get('window');
    21‚Üí
    22‚Üíconst FIT_OPTIONS: { value: FitRating; label: string; emoji: string }[] = [
    23‚Üí  { value: 'too_small', label: 'Too Small', emoji: 'üò§' },
    24‚Üí  { value: 'just_right', label: 'Perfect', emoji: 'üòç' },
    25‚Üí  { value: 'too_large', label: 'Too Large', emoji: 'ü´†' },
    26‚Üí];
    27‚Üí
    28‚Üí// Body-part feedback options (shown only when fit is not perfect)
    29‚Üítype BodyPartKey = 'chest' | 'waist' | 'sleeves' | 'length';
    30‚Üí
    31‚Üíinterface BodyPartOption {
    32‚Üí  key: BodyPartKey;
    33‚Üí  label: string;
    34‚Üí  icon: string;
    35‚Üí}
    36‚Üí
    37‚Üíconst BODY_PART_OPTIONS: BodyPartOption[] = [
    38‚Üí  { key: 'chest', label: 'Chest/Shoulders', icon: 'üëî' },
    39‚Üí  { key: 'waist', label: 'Waist', icon: 'üìè' },
    40‚Üí  { key: 'sleeves', label: 'Sleeves/Arms', icon: 'üí™' },
    41‚Üí  { key: 'length', label: 'Length', icon: 'üìê' },
    42‚Üí];
    43‚Üí
    44‚Üíinterface ColorOption {
    45‚Üí  variant_id: number;
    46‚Üí  color_name: string;
    47‚Üí  swatch_url: string | null;
    48‚Üí  hex_code: string | null;
    49‚Üí}
    50‚Üí
    51‚Üíexport default function ConfirmScreen() {
    52‚Üí  const router = useRouter();
    53‚Üí  const params = useLocalSearchParams<{
    54‚Üí    product_id: string;
    55‚Üí    brand: string;
    56‚Üí    title: string;
    57‚Üí    category: string;
    58‚Üí    image_url: string;
    59‚Üí    sizes: string;
    60‚Üí    colors: string;
    61‚Üí    fits: string;
    62‚Üí    entry_point?: string; // 'scan' | 'closet'
    63‚Üí  }>();
    64‚Üí
    65‚Üí  const sizeOptions: SizeOption[] = params.sizes ? JSON.parse(params.sizes) : [];
    66‚Üí  const colorOptions: ColorOption[] = params.colors ? JSON.parse(params.colors) : [];
    67‚Üí  const fitOptions: string[] = params.fits ? JSON.parse(params.fits) : [];
    68‚Üí  const productId = params.product_id ? parseInt(params.product_id, 10) : 0;
    69‚Üí
    70‚Üí  // Wizard state
    71‚Üí  const [currentStep, setCurrentStep] = useState(0);
    72‚Üí  const slideAnim = useRef(new Animated.Value(0)).current;
    73‚Üí
    74‚Üí  // Form state
    75‚Üí  const [selectedColor, setSelectedColor] = useState<ColorOption | null>(null);
    76‚Üí  const [isOtherColor, setIsOtherColor] = useState(false);
    77‚Üí  const [customColorName, setCustomColorName] = useState('');
    78‚Üí  const [selectedFitType, setSelectedFitType] = useState<string | null>(null); // Product fit (Classic, Slim, etc.)
    79‚Üí  const [selectedSize, setSelectedSize] = useState<SizeOption | null>(null);
    80‚Üí  const [selectedFit, setSelectedFit] = useState<FitRating | null>(null); // User's fit rating (too_small, etc.)
    81‚Üí  const [selectedBodyParts, setSelectedBodyParts] = useState<Set<BodyPartKey>>(new Set());
    82‚Üí  const [notes, setNotes] = useState('');
    83‚Üí  const [ownsGarment, setOwnsGarment] = useState<boolean | null>(
    84‚Üí    params.entry_point === 'closet' ? true : null
    85‚Üí  );
    86‚Üí  const [saving, setSaving] = useState(false);
    87‚Üí
    88‚Üí  // Determine steps dynamically
    89‚Üí  // Body-parts step only shows when fit is NOT 'just_right'
    90‚Üí  const hasColors = colorOptions.length > 0;
    91‚Üí  const hasFitTypes = fitOptions.length > 0;
    92‚Üí  const needsBodyParts = selectedFit !== null && selectedFit !== 'just_right';
    93‚Üí
    94‚Üí  const steps = [
    95‚Üí    ...(hasColors ? ['color'] : []),
    96‚Üí    ...(hasFitTypes ? ['fit_type'] : []),
    97‚Üí    'size',
    98‚Üí    'fit',
    99‚Üí    ...(needsBodyParts ? ['body_parts'] : []),
   100‚Üí    'ownership',
   101‚Üí  ];
   102‚Üí  const totalSteps = steps.length;
   103‚Üí
   104‚Üí  const animateToStep = (step: number) => {
   105‚Üí    Animated.spring(slideAnim, {
   106‚Üí      toValue: -step * SCREEN_WIDTH,
   107‚Üí      useNativeDriver: true,
   108‚Üí      tension: 50,
